INSERT INTO public.unicaen_renderer_template (id, code, description, document_type, document_sujet, document_corps, document_css, namespace, engine) VALUES (9, 'SERMENT_DU_DOCTEUR', '<p>Texte du serment du doctorant</p>', 'pdf', 'serment_du_docteur.pdf', '<p>Version Française :<br />« En présence de mes pairs.<br /> Parvenu(e) à l''issue de mon doctorat en VAR[These#Discipline], et ayant ainsi pratiqué, dans ma quête du savoir, l''exercice d''une recherche scientifique exigeante, en cultivant la rigueur intellectuelle, la réflexivité éthique et dans le respect des principes de l''intégrité scientifique, je m''engage, pour ce qui dépendra de moi, dans la suite de ma carrière professionnelle quel qu''en soit le secteur ou le domaine d''activité, à maintenir une conduite intègre dans mon rapport au savoir, mes méthodes et mes résultats. »<br /><br />English version :<br />« In the presence of my peers.<br /> With the completion of my doctorate in VAR[These#Discipline], in my quest for knowledge, I have carried out demanding research, demonstrated intellectual rigour, ethical reflection, and respect for the principles of research integrity. As I pursue my professional career, whatever my chosen field, I pledge, to the greatest of my ability, to continue to maintain integrity in my relationship to knowledge, in my methods and in my results »<br /><br /></p>
INSERT INTO public.unicaen_renderer_template (id, code, description, document_type, document_sujet, document_corps, document_css, namespace, engine) VALUES (41, 'FORMATION_SESSION_IMMINENTE_FORMATEUR', '<p>Courrier électronique envoyé aux formateur·trices lorsque la session est imminente</p>', 'mail', 'La session de formation VAR[Formation#Libelle] va bientôt débutée', '<p>Bonjour,</p> <p>Nous vous rappelons que la formation VAR[Formation#Libelle] dont vous êtes déclaré·e comme formateur·trice va bientôt débuter.<br /><br />Les séances de cette formation se tiendront :<br />VAR[Session#SeancesTable]</p> <p>Cordialement,<br />VAR[Formation#Responsable]</p>', NULL, 'Formation\Provider\Template', 'default');
