INSERT INTO public.unicaen_renderer_template (id, code, description, document_type, document_sujet, document_corps, document_css, namespace, engine) VALUES (3, 'FORMATION_INSCRIPTION_LISTE_COMPLEMENTAIRE', NULL, 'mail', 'Vous êtes sur la liste complémentaire de la formation VAR[Formation#Libelle]', '<p>Bonjour VAR[Doctorant#Denomination],<br /><br />Vous êtes inscrit·e en <strong>liste complémentaire</strong> de la session de formation VAR[Formation#Libelle].<br />Vous êtes à la position VAR[Inscription#PositionComplementaire] sur cette liste.</p>
INSERT INTO public.unicaen_renderer_template (id, code, description, document_type, document_sujet, document_corps, document_css, namespace, engine) VALUES (77, 'ADMISSION_INFO_HANDICAP', '<p>Texte affiché dans le module admission</p>', 'texte', 'Informations concernant la situation d''handicap', '<p>Si oui, vous pouvez bénéficier d''un accompagnement au cours de votre cursus : N''hésitez pas à contacter le service de médecine ainsi que le service handicap santé de votre établissement.</p>', NULL, 'Admission\Provider\Template', 'default');
